INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('4da6de71-97a4-4977-a33c-94b68b684a8b', NULL, NULL, 'In garden, remains of the villa of Domitian.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('526a7338-2035-4c44-8592-02fc52bb857a', NULL, NULL, 'With streets between the tombs.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('1479208f-4109-4b12-b7f1-31417c385175', NULL, NULL, 'Amphitheater, also called villa of the late Clori, doas and the Ted Vis centuries, with parts and gardens. Villa Aldobrandini, 2698-1603.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('6796b567-426f-4769-a080-a79f21a3333c', NULL, NULL, 'Founded 1004, fortified by Pope Julius II, 1486. Church, mosaics and frescoes 11,000 books, and at a later period, collections of early Greek and Roman antiquities.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('4e5065a7-f346-425b-991c-af15904581e5', NULL, NULL, 'Founded by St. Benediet in the VI century. Three monasteries and a church. Romanesque buildings and mosaics; objects from the Villa of Nero.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('12b9aa9a-d407-4648-84cb-504256401e78', NULL, NULL, 'Also rectangular temple nearby.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('8df25a25-ff85-45f9-bb4d-9d9da51b8367', NULL, NULL, 'Also called Villa of Hadrian.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('c1d37c21-5c22-4616-a3c3-ca942a30919d', NULL, NULL, 'XVI century palace, gardens, and fountains.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('a5ef19e9-0ea2-443a-ab29-b3ac712a86a0', NULL, NULL, 'The most imposing villa built by a Roman Emperor.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('cde150b5-39a0-4b20-95c1-e2878d36dda4', NULL, NULL, 'Ruins extending over much of the city.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('c2ded8a1-98a4-4d0a-96dd-824440e5a475', NULL, NULL, '1408, containing Museo "renestino-Irberiniano, with Etruscan collections, and famous mosaio with scenes in Nile valley.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('0decb388-5b69-421a-ab1c-d44ca30d4d71', NULL, NULL, 'Also known as the River of Augustus, with famous wall painting.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('5152eb00-06e2-41b3-93f4-8cc6882cdc18', NULL, NULL, 'With gates. Citadel of ancient Signia.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('b8ee1930-47cb-4cca-a96d-7fae04526d7d', NULL, NULL, 'Temple of Apollo; Roman street; "Ponte Sodo"; Tomba Campana; Wall of citadel (called Plaza d''Arm).');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('a8e22aca-d753-4401-b637-c2e547fb5575', NULL, NULL, 'Founded in 11th century, rebuilt 14th, mosaics; treasury');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('49616133-3c30-4cb3-8b97-e374438e5397', NULL, NULL, 'Cathedral Library and Archives, manuscripts and charters, many papal.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('90587443-2ee9-4f21-aa6a-5092b2e8789f', NULL, NULL, 'With imposing walls and gate.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('f4c9b2c4-f6be-4796-ba88-6e94133859db', NULL, NULL, 'Founded by St. Benedict in 629 A.D. Church (17th-18th century), 11th century bronze door; monastic buildings; picture gallery, one of the greatest monastic libraries, 20,000 books, 1,000 manuscripts (including the 6th century "Ambrosinater"), rich collection of charters and autographs. National property administered by the monks of the Abbey.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('df46bdd3-3769-4387-ae24-40e2e32361c6', NULL, NULL, 'Pre-Roman.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('f780284f-6276-429b-8b92-7f3aaf569339', NULL, NULL, 'Partly incorporated in Church of San Pietro.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('716693c7-87bf-4854-a7bd-7858fbdb21be', NULL, NULL, 'Supposed to have belonged to Clodius, in Villa Rubino.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('cd287666-4cf6-47a9-937d-c871282736ce', NULL, NULL, 'Easter candlestick (c.1200); banner of Don John of Austria. In Archivio del Duomo, 3 Burnt Rolls, 11th-12th century. Near the City: Tomb of Munatius Planous (called Torre d''Orlando).');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('e6d8f9ca-5a14-46b2-9628-cd7f63e12de4', NULL, NULL, 'Mainly 12-18th century, with castle of the Caetini, two churches, and monastery.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('911e2d70-ce4f-4383-8ab1-d9567d5b6ea5', NULL, NULL, 'Including citadel, walls, two temples, aqueduct.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('e30b2b81-41a9-4cd9-b9b4-5de6b05a7c6f', NULL, NULL, '12th-13th century with cloisters and monastic buildings, where Thomas Aquinas died, 1274.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('9183bfeb-1c02-4ba3-8e3f-eeec50472cc8', NULL, NULL, 'With inscribed pavement and Cathedral (12th century) incorporating temple.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('a2d980ca-8d0c-4037-8e53-82527ebabe4b', NULL, NULL, 'Chief annuary of Terracina.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('db0ef68b-fc42-4d07-9bb1-2dace796d123', NULL, NULL, 'And adjacent cloister.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('52fa18d1-e1a6-40cd-ab27-c556b58b2fb1', NULL, NULL, 'With Loggia, scene of 3 papal elections, 18th century.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('6220a412-0658-44a7-9381-32faeee067e3', NULL, NULL, 'With medieval houses including Casa Posola, Palazzo degli Alessandri; adjacent, San Pellegrino quarter with many medieval houses.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('ea4446d4-1546-4329-a820-55eb44ba7ea9', NULL, NULL, 'In old monastery church of S. Maria della Verita; antiquities; paintings by Lorenzo da Viterbo.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('46be1fd1-fdfc-4c7c-95dd-051931e753c7', NULL, NULL, '(11th-16th century); Renaissance sculpture, museum with Etruscan monuments; catacombs of St. Cristina and her tomb. Scene of the Miracle of Bolsena in 1263 (appearance of blood on the host) which led to institution of festival of Corpus Christi.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('3ad84328-ef04-4d57-8246-68483d166615', NULL, NULL, 'With well-preserved wall.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('69e1366c-2a84-4a34-ad26-44117f1b3571', NULL, NULL, 'Walls, temple, bath, tombs.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('8f93195d-74a5-4515-a574-79abf277168f', NULL, NULL, '(18th-16th century), with Museo Nazionale Tarquiniese, important Etruscan collection. Environa: Etruscan cemetery, with painted tombs.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('bfcb571f-1244-4067-8ad5-c9437b522132', NULL, NULL, '(VIII-XII centuries); choir screen, 11th century frescoes.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('137d10c8-c5b0-49a5-9d46-3fb0cee18ced', NULL, NULL, 'Main altar, choir stalls, bishop''s throne, altarpiece (Crivelli); treasury. Baptistery (12th cent), font.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('eee0223a-eac0-4959-8499-1dd051b67617', NULL, NULL, 'With museum; paintings, tapestries, ceramics. Pilgrimages on all festivals of Virgin, especially September 8.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('6a9f40be-3b52-44a0-816d-7e1c9d90d200', NULL, NULL, 'Palazzo Comunale with Pinacoteca and Museo Civico; prehistoric and Roman antiquities, wrought iron, vestments.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('0397b884-e342-4b70-9056-bbe0305dd470', NULL, NULL, 'Paintings, ceramics.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('b71f4763-453a-47ea-b4e0-3a539cf06618', NULL, NULL, '117,000 books, 609 manuscripts; materials dealing with Dante and civil and ecclesiastical history of the region.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('16684b2c-4ce3-40e6-9c44-5dae8f5bc3ac', NULL, NULL, 'Treasury.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('946ce435-f45e-4f23-8f4f-ea9b64275694', NULL, NULL, 'Home of the great Italian poet with his private library, 26,000 books; autographs and documents.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('061a6e2e-bba2-4a18-830b-41bdbbea1f1f', NULL, NULL, 'Collinga. Pinacoteca and museum of ceramics.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('49be236b-ac2b-4fdd-93f9-2ec3997915db', NULL, NULL, 'Prehistoric and Roman antiquities, medieval and Renaissance sculpture, paintings and ceramics; library; 75,000 books, 200 manuscripts (16 illuminated). Property of private association. Environa: Villa Imperiales frescoes, courts, gardens.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('fbd2eedb-ccf4-4332-8ad3-0190c659370a', NULL, NULL, 'Erected A.D. 9.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('7c9b79e0-ec3b-4640-b8aa-f7570519d55c', NULL, NULL, 'Sculpture, especially richly decorated tombs.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('c1ac445b-b6a1-4e60-b376-9ea93af21b68', NULL, NULL, 'Altarpiece by Lorenzetti.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('05df6c33-6510-48de-b5af-ac9a84c22071', NULL, NULL, 'Famous frescoes by Piero della Francesca.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('f143d600-7c4a-4013-9fa7-15335d0bcf2f', NULL, NULL, 'Prehistoric, Etruscan and Roman (Aretine pottery) collections; paintings; library with early manuscripts.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('224dbcc4-a5ad-4688-9a82-1e320cabe3a9', NULL, NULL, 'Roman sarcophagus; paintings; vestments.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('d5a0be9e-4ad0-48b8-a192-163cf09541ec', NULL, NULL, 'Paintings by Angelico, Sassetta, Signorelli.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('95a6f060-9205-4141-ba3e-0be02444498b', 2, 'Noteworthy XIV century tombs.', 'XIV century tombs. First Saturday in May, liquification of the blood of St. Januarius (see above under Cattedrale).');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('025f0991-a7d5-4da1-8882-da670b250a63', 1, 'Noteworthy tombs', 'Portal with terra cotta relief.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('bc491839-fa20-4645-bd17-73b7d4145ebb', 0, 'Baroque paintings', NULL);
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('a7d1ab76-94ec-4b3d-8223-49c602124b9b', 0, 'Dedicated to San Gennaro, patron saint of Naples. In the Chapel di San Gennaro, is also the Tesoro of the Cathedral are the relics his blood.', 'Dedicated to San Gennaro (St. Januarius), patron saint of Naples.');
INSERT INTO "public"."items_harvard_list_data" ("id", "long_list_stars", "long_list_text", "short_list_text") VALUES ('98f4a9b3-93e0-49f6-ad75-ed9002d274f0', 0, 'Good frescoes', 'Paintings by Fra Angelico.');
